#
# View "v_books_seat"
#

CREATE
  ALGORITHM = UNDEFINED
  VIEW `v_books_seat`
  AS
SELECT
  `book_info`.`bookBarCode`,
  `book_info`.`bookISBN`,
  `book_info`.`bookTitle`,
  `book_info`.`bookAuthor`,
  `book_info`.`bookPress`,
  `book_info`.`bookPublish`,
  `book_info`.`bookPrintCount`,
  `book_info`.`bookCategoryId`,
  `book_info`.`bookComment`,
  `book_info`.`bookCount`,
  `book_category`.`bookCategory`,
  `book_category`.`categoryCount`,
  `book_primary`.`bookSeat`,
  `book_primary`.`bookStatusId`,
  `book_primary`.`bookBorrowCount`,
  `book_seat`.`seatStatus`,
  `book_status`.`bookStatus`
FROM
  ((((`book_info`
    JOIN `book_primary` ON ((`book_info`.`bookBarCode` = `book_primary`.`bookBarCode`)))
    JOIN `book_seat` ON ((`book_primary`.`bookSeat` = `book_seat`.`bookSeat`)))
    JOIN `book_status` ON ((`book_primary`.`bookStatusId` = `book_status`.`bookStatusId`)))
    JOIN `book_category` ON ((`book_info`.`bookCategoryId` = `book_category`.`bookCategoryId`)));

